import React from "react"
import Logo from "../../Photo/Learn"




export const Learning = () => {
    return (
        <div className="content">
          <img src={Logo} />
          <h1>Программа обучения</h1>
          <p>Больше 90% учеников прошли полный курс и смогли собрать свой первый компьютер</p>
        </div>
    )
}
